materials.vertexShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform mat4 iWorld2ObjectMatrix;
//header-end
varying vec3 fNormal;
varying vec3 fPosition;
varying vec2 fUV;

void main()
{
    fNormal = normal;
    vec4 wpos = modelMatrix * vec4(position, 1.0);
    fPosition = wpos.xyz;
    fUV = uv;
    gl_Position = projectionMatrix * modelViewMatrix * vec4( position, 1.0 );
}

materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform mat4 iWorld2ObjectMatrix;
//header-end
varying vec3 fPosition;
varying vec3 fNormal;
varying vec2 fUV;


vec2 polarMap(vec2 uv, float shift, float inner, out float r) {
    uv = vec2(0.5) - uv;
    float px = 1.0 - fract(atan(uv.y, uv.x) / 6.28 + 0.25) + shift;
    r = sqrt(uv.x * uv.x + uv.y * uv.y);
    float py = (r * (1.0 + inner * 2.0) - inner) * 2.0;
    return vec2(px, py);
}

void main()
{
    float r = 0.896;
    vec2 maskUV = polarMap(fUV, 1.084, -0.188,r) + vec2(0,-iTime)*1.064;
    vec4 mask = texture2D(iTexture0, maskUV) * 2.264;
    vec4 ramp = texture2D(iTexture1, vec2(r*1.184,0));
    gl_FragColor = mask * ramp * pow(ramp.r,2.864);
}

